|Details = [[Palm sapling]]s are used to train [[Farming]]. Because it is time consuming and gives little to no experience, planting the [[palm tree seed]]s in [[filled plant pot]]s to grow saplings is often skipped in favour of buying the saplings directly from the [[Grand Exchange]]. This opens up an opportunity to grow palm saplings for profit. Like all methods involving large amounts of buying and selling, which require a relatively high capital to start, it is recommended to test the market by growing one sapling first to make sure it is profitable.

To plant the seeds in the pots, use one of them on the other with a [[gardening trowel]] in your inventory. This produces a [[seedling]]. When all the plant pots are filled with seeds, cast [[Humidify]] to water them. These watered seedlings will take approximately five minutes to turn into saplings, but this will happen even when [[bank]]ed. Repeating this process quickly will make around 1,700 saplings an hour.

Saplings can also be watered with [[watering can]]s instead of Humidify, however this makes the process far more click-intensive and time-consuming.

Please note that palm tree seeds have a relatively low [[Grand Exchange#Buying limit|buying limit]], so you may want to stock up on them beforehand, or grow several different trees at once.

Once you've finished making the saplings, sell them on the Grand Exchange. Maximise your profit by buying one sapling instantly, and selling all of yours for slightly less than that.

If for whatever reason palm trees aren't possible for you, this method can be very profitable with other seeds as well. Use this table to determine what the best seed for you is.
